console.log("This works");const WEDDING_DATE=new Date("February 1, 2020 10:00:00").getTime(),keepCount=setInterval(()=>{const e=(new Date).getTime();let t=WEDDING_DATE-e;const o=document.querySelector("#day"),n=document.querySelector("#hour"),r=document.querySelector("#second"),c=document.querySelector(".invite-timer__countdown");var a=Math.floor(t/864e5),l=Math.floor(t/36e5%24),u=Math.floor(t/1e3%60);o.textContent=a,n.textContent=l,r.textContent=u,t<0&&(clearInterval(keepCount),c.innerHTML="<span> WE MADE IT </span>")},1e3);